import style from './Footer.module.scss';

export const Footer = () => {
    return (
        <div className={style.Wrapper}>
            <div className={style.Container}>
                <div className={style.LogoBlock}>
                    <Logo/>
                    <p>Cashbridge</p>
                </div>
            </div>
        </div>
    )
}
